Nasi se putovi razilaze (1957) Domaci Film



Zagreb u vreme Drugog svetskog rata. Ilegalka Vjera raskida s kolegom Mirkom, priznavsi mu da se zaljubila u Vilka Klancara, impresionirana kako se on drzao na policijskom ispitivanju. Vjera i ne sluti da je Vilko tom prigodom postao denuncijant i da ce pogresna ljubavna procena ugroziti njene najblize. 

